class Solution {
    public int numberOfSequence(int n, int[] sick) {
        final int MOD = 1000000007;
        long result = 1;
        // For gaps between sick children
        for (int i = 1; i < sick.length; i++) {
            int gap = sick[i] - sick[i - 1] - 1;
            result = (result * countWays(gap)) % MOD;
        }
        // For gaps before the first sick child and after the last sick child
        if (sick[0] > 0) result = (result * countWays(sick[0])) % MOD;
        if (sick[sick.length - 1] < n - 1) result = (result * countWays(n - 1 - sick[sick.length - 1])) % MOD;
        return (int) result;
    }

    private long countWays(int gap) {
        if (gap <= 1) return 1;
        long[] dp = new long[gap + 1];
        dp[0] = 1; dp[1] = 1;
        for (int i = 2; i <= gap; i++) {
            dp[i] = (dp[i - 1] + dp[i - 2]) % 1000000007;
        }
        return dp[gap];
    }
}
